// Composant Gto
function Gto(){
    return (
    <div>
        <h1>GTOSINT</h1>
        <h1>VIDEO</h1>
        <p>
    <strong>GTOsint</strong> est une application web innovante conçue pour permettre aux utilisateurs d’accéder facilement à certaines données de jeu d’un joueur, simplement en renseignant son pseudonyme. Ce projet full-stack allie des technologies modernes tant pour le développement front-end que back-end, tout en intégrant des APIs tierces et une base de données robuste. L’interface utilisateur, ergonomique et intuitive, a été entièrement développée avec le framework Angular, garantissant une expérience fluide et dynamique.

    Ce projet s’inscrit dans le cadre de notre troisième année de licence en Informatique à l’Université du Mans, plus précisément dans les enseignements des modules "Interaction Personne-Machine (IPM)" et "Architecture Web". Il illustre notre capacité à concevoir une application complète, de la conception à la mise en production, en mobilisant des compétences en design, développement, et intégration logicielle.
</p>


    </div>

    );
}

export default Gto;
